<?phpnamespace Nemundo\App\WebService\Install;use Nemundo\App\Application\Setup\ApplicationSetup;use Nemundo\App\Application\Type\Install\AbstractInstall;use Nemundo\App\WebService\Application\WebServiceApplication;use Nemundo\App\WebService\Data\WebServiceModelCollection;use Nemundo\Model\Setup\ModelCollectionSetup;class WebServiceInstall extends AbstractInstall{    public function install()    {        (new ApplicationSetup())->addApplication(new WebServiceApplication());        (new ModelCollectionSetup())->addCollection(new WebServiceModelCollection());    }}